import React, { Component } from 'react'
import x from '../N.jpg'
export class Navbar extends Component {
  render() {
    const [liState,liStateSet]=liStateSet("White");
    let clickEffects=()=>{
      liStateSet("Violet");
    }
    return (
      <div>
        <nav className="navbar bg-dark">
          <div className="container-fluid">
            <a className="navbar-brand" href="#">
              <img src={x} alt="Logo" width="50" height="54" className="d-inline-block align-text-top mx-3" />
              <strong style={{ color: "white", fontFamily: "cursive" }}>NikharaNEWS</strong>
            </a>
            <ul className="navbar-nav d-flex flex-row mb-3 p-2 m-2 me-auto mb-2 mb-1g-0">
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color:{liState}, fontFamily: "cursive" }} onClick={clickEffects}>Business</a></li>
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color: "white", fontFamily: "cursive" }} onClick={clickEffects}>Entertainment</a></li>
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color: "white", fontFamily: "cursive" }} onClick={clickEffects}>General</a></li>
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color: "white", fontFamily: "cursive" }} onClick={clickEffects}>Health</a></li>
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color: "white", fontFamily: "cursive" }} onClick={clickEffects}>Science & Tech</a></li>
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color: "white", fontFamily: "cursive" }} onClick={clickEffects}>Sports</a></li>
              <li className="nav-item"><a href="/" className="nav-link mx-3" style={{ color: "white", fontFamily: "cursive" }} onClick={clickEffects}>International</a></li>
            </ul>
          </div>
        </nav >
      </div >
    )
  }
}

export default Navbar
